function Main() {
    return (
        <div className="main2">
            <div>
                <a href="/create"><button className="btn btn-secondary">Створити замітку</button></a>
            </div>
            <div>
            <a href="/note"><button className="btn btn-secondary">Подивитись замітку</button></a>
            </div>
         </div>
    );
}

export default Main;
